<p>\u968F\u7740\u4E1A\u52A1\u91CF\u7684\u6269\u5C55\u3001\u5982\u679C\u662F\u5355\u673A\u90E8\u7F72\u7684MySQL\uFF0C\u4F1A\u5BFC\u81F4I/O\u9891\u7387\u8FC7\u9AD8\u3002\u91C7\u7528\u4E3B\u4ECE\u590D\u5236\u3001\u8BFB\u5199\u5206\u79BB\u53EF\u4EE5\u63D0\u9AD8\u6570\u636E\u5E93\u7684\u53EF\u7528\u6027\u3002</p>
